const namedict= data.namedict
function dseselectDict(branchVariable){
    switch(branchVariable){
        case 'civil':
            return dsecivil;
        case 'comp':
            return dsecomp;
        case 'entc':
            return dseentc;
        case 'mech':
            return dsemech;
        case 'ele':
            return dseele;
    }
}
//*/***********************************USE FUNCTIOJN sortByDistrict  after this
function dsearrangeIndiscending(gender,cat,dict){
    const combinetext=gender+cat
        switch(combinetext){
        case 'maleopen':
            dict.sort((a, b) => {
            return b.gopen - a.gopen;
             })
        case 'maleobc':
            dict.sort((a, b) => {
            return b.gobc - a.gobc;
            })
        case 'malesc':
            dict.sort((a, b) => {
            return b.gsc - a.gsc;
            })
        case 'malest':
            dict.sort((a, b) => {
            return b.gst - a.gst;
            })
        case 'femaleopen':
            dict.sort((a, b) => {
            return b.lopen - a.lopen;
            })
        case 'femaleobc':
            console.log("inside")
            dict.sort((a, b) => {
            return b.lobc - a.lobc;
            })
            return dict 
        case 'femalesc':
            dict.sort((a, b) => {
            return b.lsc - a.lsc;
            })

        case 'femalest':
            dict.sort((a, b) => {
            return b.lst - a.lst;
            })
        }

}
function dseproduceCatlist(dict,gender,cat){
    let catlist = []
    switch(gender+cat){
        case 'maleopen':
            catlist = dict.map(({gopen})=>gopen);
            return catlist
        case 'maleobc':
            catlist = dict.map(({gobc})=>gobc);
            return catlist
        case 'malesc':
            catlist = dict.map(({gsc})=>gsc);
            return catlist
        case 'malest':
            catlist = dict.map(({gst})=>gst);
            return catlist
        case 'femaleopen':
            catlist = dict.map(({lopen})=>lopen);
            return catlist
        case 'femaleobc':
            catlist = dict.map(({lobc})=>lobc);
            return catlist
        case 'femalesc':
            catlist = dict.map(({lsc})=>lsc);
            return catlist
        case 'femalest':
            catlist = dict.map(({lst})=>lst);
            return catlist
        }  
    
}
function dsegivefinal(cat,gender,dist1,dist2,dist3,branch,inputnum){
    console.log(cat,gender,dist1,dist2,dist3,branch,inputnum)
    const dict1=dseselectDict(branch)
    const dict2=data.sortBydistrict(dict1,dist1,dist2,dist3)
    const dict3=dsearrangeIndiscending(gender,cat,dict2)
    const list1=dseproduceCatlist(dict3,gender,cat)
    const index1=data.nearest_number(list1,inputnum)
    const list2=data.produceDtecodes(dict3,index1)
    // console.log('this is list2',list2)
    let final_dict=[]
    list2.forEach(function makefinaldict(item){dict3.map((dict)=>{
        if (dict.dte === item){
            let combine=gender+cat
            let cutoff1 = ""
            switch(combine){
                case 'maleopen':
                    cutoff1=dict.gopen
                case 'maleobc':
                    cutoff1=dict.gobc
                case 'malesc':
                    cutoff1=dict.gsc
                case 'malest':
                    cutoff1=dict.gst
                case 'femaleopen':
                    cutoff1=dict.lopen
                case 'femaleobc':
                    cutoff1=dict.lobc
                case 'femalesc':
                    cutoff1=dict.lsc
                case 'femalest':
                    cutoff1=dict.lst
            }
            final_dict.push({dte:dict.dte,cutoff:cutoff1,dist:dict.dist,name:namedict[item].name,web_address:data.webdict[item]
            })
        }
    })})
    console.log(final_dict)
    return(final_dict)
} 
export default{dsecivil,dsecomp,dseele,dsemech,dseentc,namedict,dseselectDict,dsearrangeIndiscending,dseproduceCatlist,dsegivefinal}
